// ProductSection.jsx

import { motion } from "framer-motion";
import Card from "./Card";

const products = [
  {
    id: 1,
    image:
      "data:image/jpeg;base64,",
    title: "HTML",
  },
  {
    id: 2,
    image:
      "data:image/jpeg;base64,",
    title: "CSS",
  },
  {
    id: 3,
    image:
      "data:image/jpeg;base64,",
    title: "JAVASCRIPT",
  },
  {
    id: 4,
    image:
      "data:image/jpeg;base64,",
    title: "PYTHON",
  },
  {
    id: 5,
    image:
      "data:image/jpeg;base64,",
    title: "REACT JS",
  },
  {
    id: 6,
    image:
      "data:image/jpeg;base64,",
    title: "NODE JS",
  },
  {
    id: 7,
    image:
      "data:image/jpeg;base64,",
    title: "JAVA",
  },
  {
    id: 8,
    image:
      "data:image/jpeg;base64,",
    title: "PHP",
  },
];

const OurCourses = () => {
  return (
    <div className="container mx-auto py-12">
      {/* Heading */}
      <h2 className="text-3xl font-bold text-center mb-8 text-gray-800">
        Programming courses
      </h2>

      <motion.div
        className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6"
        initial="hidden"
        animate="visible"
        exit="hidden"
        variants={{
          hidden: { opacity: 0 },
          visible: {
            opacity: 1,
            transition: {
              staggerChildren: 0.2,
            },
          },
        }}
      >
        {products.map((product) => (
          <Card key={product.id} image={product.image} title={product.title} />
        ))}
      </motion.div>
    </div>
  );
};

export default OurCourses;
